import { Morph } from "lively.morphic/morph.js";

export default class UndoViewer extends Morph {

  onLoad() {
    var items = this.getQueue(this.target),
        propertyList = this.getSubmorphNamed('propertyList'),
        valueList = this.getSubmorphNamed('valueList')
  }
  getQueue(target){
    if (!target){ return }
    return target.env.changeManager.changes.filter(function(ea){
      return ea.target = target
    })
  }
}
